import React from 'react'
import {Divider} from '@material-ui/core'

export default function Title(){
    return(
        <>
            <h1 style = {{
                color: 'whitesmoke', 
                marginTop: '5%',
                marginLeft: '30%', 
                position: 'absolute',
                left: '30'
            }}>Hola mi nombre es Edgar!</h1>
            <Divider />
            <h3>FullStack Web Developer</h3>
        </>
    )
}
